  false,\n\t\"url\": null,\n\t\"notes\": \"This biological study is one of four study
  elements outlined in the Fish and Wildlife Service's plan of study for the Malheur-Harney
  Lakes Basin, Oregon (July 1972, Revised December 1974). The other elements of the
  proposed study were: 1) land and water resources availability; 2) current land and
  water resource use and management; and 3) socioeconomics. The basin study proposal
  was initiated at the request of the Oregon water Resources Board in 1971 as a result
  of conflicting demands and opinions between water development and wildlife interests.
  The request was In accord with the  Columbia-North Pacific Comprehensive Study which
  recommended that detailed studies be conducted before water and land management
  plans are developed for the basin.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
